const Header = props => {
    return (
        <div id="wrapper">
            <div>
                Header
            </div>
            <div className="count">
                <p>3 free search: <span>You have 2 left</span></p>
            </div>
            <div id="actions">
                {
                props.actions ? 
                    props.actions.map((action, index) => (
                    <div key={index}>{action}</div>
                    )):''
                }
            </div>

        <style jsx>{`
            #wrapper {
                display: flex;
                width: 100%;
                padding: 10px 0 10px 0;
            }

            #actions {
                display: flex;
                align-items: center;

            }

            #actions > * {
                margin: 0 5px 0 5px;
            }

            .count{
                display: flex;
                margin-left: auto;
                margin-right: auto;
            }

            .count p {
                margin: 0;
            }

            .count span {
                font-weight: bold;
            }
        `}</style>
        </div>
    )
}

export default Header
